function UsersList(params) {
  function showList() {
    if (params.age === 0 || params.name.length === 0) {
      <p> </p>;
    }
  }

  return (
    <ul>
      <li>Username is Si {params.name}</li>
      <li>{params.age}</li>
    </ul>
  );
}
export default UsersList;
